class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """

        ## binary search
        #Runtime: 72 ms, faster than 6.82% of Python online submissions for Two Sum II - Input array is sorted.
        #Memory Usage: 12.5 MB, less than 10.91% of Python online submissions for Two Sum II - Input array is sorted.
        '''
        left = 0
        right = len(numbers) - 1
        length = len(numbers)
        middle = 0
        for i in range(0,len(numbers)-1):
            left = i+1
            right = len(numbers)-1
            tmp = target - numbers[i]

            while left <= right:
                middle = left +(right - left)//2
         
                if numbers[middle] > tmp:
                    right = middle - 1
                
                elif numbers[middle] < tmp:
                    left = middle+1

                elif numbers[middle] == tmp:
                    return [i+1,middle+1]
        '''
        ## two pointer
        #Runtime: 44 ms, faster than 91.04% of Python online submissions for Two Sum II - Input array is sorted.
        #Memory Usage: 12 MB, less than 52.73% of Python online submissions for Two Sum II - Input array is sorted.
        left = 0
        right = len(numbers)-1
        while left < right:
            tmp = numbers[left]+numbers[right]
            if tmp == target:
                return [left+1,right+1]
            elif tmp < target:
                left = left + 1
            else:
                right = right -1
        
